    """
    If the hour is between 0 and 8, return 'sleeping'. 
    Else, return 'weekend' if the day is 'Sat' or 'Sun'. 
    Else, return 'weekday' if the day is any day between 'Monday' and 'Friday'.
    """

    if 0 <= hour < 8:
